import React from 'react';
import SongList from './SongList';
import { listsongs } from '../json/songs';

function App() {
    const { songs } = listsongs;
    const handleCick = () => {
        console.log("cicked");
    }
    return (
        <div>
            <SongList songs={songs} onClick={handleCick}/>
        </div>
    );
}
export default App;
